import React from "react";

export default function NavBarLinks(props) {
   let eventToSend = (e) => {
      var myHeaders = new Headers();
      myHeaders.append("", "health");
      myHeaders.append("Content-Type", "application/x-www-form-urlencoded");

      var urlencoded = new URLSearchParams();
      urlencoded.append("topic", e.target.text);

      var requestOptions = {
         method: 'POST',
         headers: myHeaders,
         body: urlencoded,
         redirect: 'follow'
      };

      fetch("http://localhost:3000/topics", requestOptions)
         .then(response => response.text())
         .then(result => console.log(result))
         .catch(error => console.log('error', error));
   }
   return (
      <div className="dropdown">
         <div className="dropbtn">
            {props.name}
            <svg
               width="1em"
               height="1em"
               viewBox="0 0 16 16"
               className="bi bi-chevron-down"
               fill="currentColor"
               xmlns="http://www.w3.org/2000/svg"
            >
               <path
                  fillRule="evenodd"
                  d="M1.646 4.646a.5.5 0 0 1 .708 0L8 10.293l5.646-5.647a.5.5 0 0 1 .708.708l-6 6a.5.5 0 0 1-.708 0l-6-6a.5.5 0 0 1 0-.708z"
               />
            </svg>
         </div>
         <div className="dropdown-content" onClick={eventToSend}>

            <a href={props.url}>{props.link1}</a>
            <a href={props.url}>{props.link2}</a>
            <a href={props.url}>{props.link3}</a>
            <a href={props.url}>{props.link4}</a>
            <a href={props.url}>{props.link5}</a>
            <a href={props.url}>{props.link6}</a>
            <a href={props.url}>{props.link7}</a>
            <a href={props.url}>{props.link8}</a>
         </div>
      </div>
   );
}
